import argparse,sys,csv,os
from fillpdf import fillpdfs
from base64 import b64decode

#base64 template 475 file
template_file = ''

#decode 475 file
bytes = b64decode(template_file, validate=True)
f = open('af475.pdf', 'wb')
f.write(bytes)
f.close()

fillpdfs.get_form_fields("af475.pdf")

with open ('student-info.csv') as csv_file:
    read_csv = csv.DictReader(csv_file,delimiter=',')
    num = 1
    for row in read_csv:
            name = row['name']
            rank = row['rank']
            dafsc = row['dafsc']
            org = row['org']
            from_date = row['from_date']
            thru_date = row['thru_date']
            location = row['location']
            course_title = row['course_title']
            afsc = row['afsc']
            dg_criteria = row['dg_criteria']
            accomplishments = row['accomplishments']
            qualities = row['qualities']
            duty_title = row['duty_title']
            ssn = row['ssn']
            eval_ssn = row['eval_ssn']
            sig_block = row['sig_block']
            weeks = row['weeks']
            check1 = row['check1']
            check2 = row['check2']
            check3 = row['check3']
            check4 = row['check4']
            check5 = row['check5']
            check6 = row['check6']
            other_comments = row['other_comments']
            sign_date = row['sign_date']

            data_dict = {
                'NAME': name, 
                'RANK': rank, 
                'DUTY AFSC': dafsc, 
                'ORGANIZATION COMMAND AND LOCATION': org, 
                'FROM': from_date, 
                'THRU': thru_date, 
                'NAME AND LOCATION OF SCHOOL OR INSTITUTION': location, 
                'NAME OR TITLE OF COURSE': course_title, 
                'AFSC': afsc, 
                'DG AWARD CRITERIA': dg_criteria, 
                'TRAINING ACCOMPLISHMENTS': accomplishments, 
                'PROFESSIONAL QUALITIES': qualities, 
                'DUTY TITLE': duty_title, 
                'SSN': ssn,
                'EVAL-SSN': eval_ssn,
                'SIGNATURE BLOCK': sig_block, 
                'WEEKS': weeks, 
                'Check1': check1, 
                'Check2': check2, 
                'Check3': check3, 
                'Check4': check4, 
                'Check5': check5, 
                'Check6': check6, 
                'OTHER COMMENTS': other_comments, 
                'DATE': sign_date
            }

            fillpdfs.write_fillable_pdf('af475.pdf', 'AF475 - '+name+'.pdf', data_dict)

            num = num + 1

csv_file.close()
os.remove('af475.pdf')